using Domain;
using Microsoft.EntityFrameworkCore;

namespace TGTG_EF;
public class TGTGSeedData : ISeedData
{
    private TGTGDbContext _context;

    public TGTGSeedData(TGTGDbContext context)
    {
        _context = context;

    }

    public async Task EnsurePopulated(bool dropExisting = false)
    {
        _context.Employees.RemoveRange(_context.Employees);
        _context.Students.RemoveRange(_context.Students);
        _context.Products.RemoveRange(_context.Products);
        _context.Packets.RemoveRange(_context.Packets);
        //_context.Canteens.RemoveRange(_context.Canteens);

        _context.Canteens.AddRange(new[]
        {
            new Canteen { City = City.BREDA, Location = "HA", WarmMeals = true},
            new Canteen { City = City.BREDA, Location = "LD", WarmMeals = true},
            new Canteen { City = City.BREDA, Location = "LA", WarmMeals = false},
            new Canteen { City = City.TILBURG, Location = "CHL", WarmMeals = true},
            new Canteen { City = City.TILBURG, Location = "MD", WarmMeals = false},
            new Canteen { City = City.DENBOSCH, Location = "OWB215", WarmMeals = true},
            new Canteen { City = City.DENBOSCH, Location = "HP", WarmMeals = false}
        });

        _context.Employees.AddRange(new[] {
            new Employee { EmailAddress = "canteenworker1@mail.com", Name = "Merel de Laat", Canteen = 3 }
        });

        _context.Students.AddRange(new[]
        {
            new Student { EmailAddress = "student1@mail.com", Name = "Rik Vandermullen", StudentNumber = 2116527, PhoneNumber = "0658942232", BirthDate = new DateTime(1998,09,11), City = "Breda", noShows = 0}
        });

        var Product1 = new Product { Name = "Appel", HasAlcohol = false, Image = "data:image/png;base64," };
        var Product2 = new Product { Name = "Wortel", HasAlcohol = false, Image = "data:image/png;base64," };
        var Product3 = new Product { Name = "Bier", HasAlcohol = true, Image = "data:image/png;base64," };
        var Product4 = new Product { Name = "Chips", HasAlcohol = false, Image = "data:image/png;base64," };

        _context.Products.AddRange(new[]
        {
            Product1,
            Product2,
            Product3,
            Product4,
        });

        List<Product> products = new List<Product>();
        products.Add(Product1);
        products.Add(Product2);

        List<Product> products2 = new List<Product>();
        products2.Add(Product3);
        products2.Add(Product4);

        _context.Packets.Add(new Packet { Name = "Groente en Fruit", CanteenId = 1, City = City.BREDA, PickUpTime = DateTime.Now, LastestPickUpTime = DateTime.Now.AddHours(5), MealType = MealType.BREAD, Price = 5.25, ReservedBy = null, ContainsAlcohol = false, Products = products});

        _context.Packets.Add(new Packet { Name = "Bier Pakket", CanteenId = 4, City = City.TILBURG, PickUpTime = DateTime.Now, LastestPickUpTime = DateTime.Now.AddHours(5), MealType = MealType.DRINKS, Price = 7.75, ReservedBy = null, ContainsAlcohol = true, Products = products2 });

        _context.SaveChanges();
    }
}
